def solve(base, exp):
    result = ()
    for i in base:
        for j in exp:
            result += (i**j,)
    return result

def solve(tup1, tup2):
    result = tuple(a ** b for a, b in zip(tup1, tup2))
    return result

def solve(base, exponent):
    result = ()
    for b in base:
        for e in exponent:
            result += (b**e,)
    return result

def solve(t1, t2):
    result = ()
    for num1 in t1:
        for num2 in t2:
            result = result + (num1 ** num2,)
    return result

def solve(tup1, tup2):
    result = ()
    for i in range(len(tup1)):
        result += (tup1[i] ** tup2[i],)
    return result
